import React from 'react';
import { UseRouteMacth, useRouteMatch } from 'react-router-dom';

interface RepositoryParams {
  repository: string;
}

const Repository: React.FC = () => {
  const { params } = useRouteMatch<RepositoryParams>();

  return (
    <h1>
      Repository:
      {params.repository}
    </h1>
  );
};

export default Repository;
